        <title>Untitled</title>
        <style>
            body {
                position: absolute;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%;
                margin: 0;
                padding: 0;
                overflow: hidden;
            }

            svg {
                display: none;
            }

            .sozi-frame-list {
                position: absolute;
                top: 0;
                right: 0;
                width: 33%;
                height: 100%;
                margin: 0;
                padding: 0.5em 1em;
                overflow-y: auto;

                list-style: decimal inside;

                font-family: "Droid Sans", Helvetica, Arial, sans-serif;
                font-size: 12pt;

                color: rgb(240, 255, 255);
                background-color: rgba(34, 34, 34, 0.9);
            }

            .sozi-frame-list li {
                margin: 0;
                padding: 0;
                overflow: hidden;
                white-space: nowrap;
                text-overflow: ellipsis;
            }

            li.sozi-title-level-1:before { content: '. . ';             color: rgb(100, 100, 100); }
            li.sozi-title-level-2:before { content: '. . . . ';         color: rgb(100, 100, 100); }
            li.sozi-title-level-3:before { content: '. . . . . . ';     color: rgb(100, 100, 100); }
            li.sozi-title-level-4:before { content: '. . . . . . . . '; color: rgb(100, 100, 100); }

            .sozi-frame-list a {
                color: inherit;
                text-decoration: none;
            }

            .sozi-frame-list a:hover {
                color: rgb(0, 204, 255);
                text-decoration: underline;
            }

            .sozi-frame-list a.current {
                color: rgb(255, 170, 68);
            }

            .sozi-frame-number {
                position: absolute;
                top: 0;
                left: 1em;
                text-align: center;
                padding: 0.3em 0.6em;

                cursor: pointer;

                font-family: "Droid Sans", Helvetica, Arial, sans-serif;
                font-size: 12pt;
                color: rgb(240, 255, 255);
                background-color: rgba(34, 34, 34, 0.9);
            }

            .sozi-blank-screen {
                background: black;
                position: absolute;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%;
                opacity: 100%;
                visibility: visible;
                z-index: 999;
                transition: opacity 0.5s, visibility 0.5s;
            }

            svg a {
                cursor: pointer;
            }

            @keyframes spinner {
                to { transform: rotate(360deg); }
            }

            .spinner:before {
                content: '';
                box-sizing: border-box;
                position: absolute;
                top: 50%;
                left: 50%;
                width: 40px;
                height: 40px;
                margin-top: -20px;
                margin-left: -20px;
                border-radius: 50%;
                border: 4px solid #ccc;
                border-top-color: #333;
                animation: spinner .8s linear infinite;
            }
        </style>

role="line" x="64.343803" y="147.03038" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:7.51099682px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.18777406">This is a reproduction of a part of what is possibly </tspan><tspan id="tspan464" sodipodi:role="line" x="64.343803" y="156.41911" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:7.51099682px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.18777406">the only surviving contemporary example for such </tspan><tspan id="tspan466" sodipodi:role="line" x="64.343803" y="165.80786" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:7.51099682px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.18777406">a map. It depicts the battlefield of the Battle at </tspan><tspan id="tspan478" sodipodi:role="line" x="64.343803" y="175.19661" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:7.51099682px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.18777406">Kniggrtz.</tspan><tspan id="tspan480" sodipodi:role="line" x="64.343803" y="184.58533" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:7.51099682px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.18777406"/><tspan id="tspan482" sodipodi:role="line" x="64.343803" y="193.97406" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:7.51099682px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.18777406">The map has been preserved by the British Library</tspan><tspan id="tspan484" sodipodi:role="line" x="64.343803" y="203.36281" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:7.51099682px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.18777406">(catalouge no. BLL01004805936) that kindly gave</tspan><tspan sodipodi:role="line" x="64.343803" y="212.75156" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:7.51099682px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.18777406" id="tspan512">permission to use it here.</tspan></text>

umeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00865653" y="148.86765" x="331.79019" sodipodi:role="line">stacles. The area is dominated by a ridge of three hills running </tspan><tspan id="tspan833" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.34626251px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00865653" y="149.30048" x="331.79019" sodipodi:role="line">from south east to north west. </tspan></text>
    <rect y="130.81435" x="345.64459" height="3.6101415" width="9.0137119" id="rect1007-5-3-8-53-0-3-7-5-0-5-0" style="opacity:1;fill:url(#radialGradient1015-8-6-5-3-1-6-8-6-0-2-0);fill-opacity:1;stroke:none;stroke-width:0.35432437;stroke-miterlimit:4;stroke-dasharray:none;stroke-opacity:1"/>
    <text id="text977-0-1-9-8-4-4-2-8-6-4-8" y="131.19708" x="345.85413" style="font-style:normal;font-weight:normal;font-size:0.26206061px;line-height:1.25;font-family:sans-serif;letter-spacing:0px;word-spacing:0px;fill:#000000;fill-opacity:1;stroke:none;stroke-width:0.00655152" xml:space="preserve"><tspan style="font-style:normal;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:'sans-serif, Bold';font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:justify;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="131.19708" x="345.85413" id="tspan975-5-2-6-6-5-6-3-5-3-8-5" sodipodi:role="line">Woodland</tspan><tspan id="tspan833-6" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="131.52466" x="345.85413" sodipodi:role="line"/><tspan id="tspan915" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="131.85223" x="345.85413" sodipodi:role="line">As in some modern maps, woodland areas are marked with tiny </tspan><tspan id="tspan917" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="132.17981" x="345.85413" sodipodi:role="line">tree symbols. Units can not see through forests. This terrain can </tspan><tspan id="tspan919" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="132.50739" x="345.85413" sodipodi:role="line">be passed by artillery (and other assets moving on wheels) only </tspan><tspan id="tspan923" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="132.83496" x="345.85413" sodipodi:role="line">on roads. Cavalry can move through woodland only at reduced </tspan><tspan id="tspan947" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="133.16255" x="345.85413" sodipodi:role="line">speed and without formation, it cannot charge the enemy in </tspan><tspan id="tspan925" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="133.49013" x="345.85413" sodipodi:role="line">this terrain.</tspan><tspan id="tspan927" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="133.8177" x="345.85413" sodipodi:role="line">It is therefore the safest place for infantry in open order. </tspan></text>

    <text id="text977-0-1-9-8-4-4-2-8-6-4-8-7" y="145.16032" x="303.88254" style="font-style:normal;font-weight:normal;font-size:0.41384768px;line-height:1.25;font-family:sans-serif;letter-spacing:0px;word-spacing:0px;fill:#000000;fill-opacity:1;stroke:none;stroke-width:0.0103462" xml:space="preserve"><tspan style="font-style:normal;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:0.41384962px;font-family:sans-serif;-inkscape-font-specification:'sans-serif, Bold';font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:justify;writing-mode:lr-tb;text-anchor:start;stroke-width:0.0103462" y="145.16032" x="303.88254" id="tspan975-5-2-6-6-5-6-3-5-3-8-5-2" sodipodi:role="line">Bog</tspan><tspan id="tspan833-6-4" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.41384962px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.0103462" y="145.67763" x="303.88254" sodipodi:role="line"/><tspan id="tspan927-8" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.41384962px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.0103462" y="146.19495" x="303.88254" sodipodi:role="line">Boggy low ground is colorized in light green. Here movement by</tspan><tspan id="tspan1047" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.41384962px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.0103462" y="146.71227" x="303.88254" sodipodi:role="line">artillery and cavalry is restricted as in woodland, but the vege-</tspan><tspan id="tspan1049" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.41384962px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.0103462" y="147.22957" x="303.88254" sodipodi:role="line">tation is not suffciently thick to provide cover from fire.</tspan></text>

    <text id="text977-0-1-9-8-4-4-2-8-6-4-8-3" y="135.60631" x="304.65649" style="font-style:normal;font-weight:normal;font-size:0.26206061px;line-height:1.25;font-family:sans-serif;letter-spacing:0px;word-spacing:0px;fill:#000000;fill-opacity:1;stroke:none;stroke-width:0.00655152" xml:space="preserve"><tspan style="font-style:normal;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:'sans-serif, Bold';font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:justify;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="135.60631" x="304.65649" id="tspan975-5-2-6-6-5-6-3-5-3-8-5-9" sodipodi:role="line">Shrubs</tspan><tspan id="tspan833-6-1" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="135.93388" x="304.65649" sodipodi:role="line"/><tspan id="tspan927-0" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="136.26146" x="304.65649" sodipodi:role="line">Shrubby areas are colorized in brown like woodland, indicating</tspan><tspan id="tspan1124" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="136.58904" x="304.65649" sodipodi:role="line">that they are also an obstacle to the line of sight and restrict</tspan><tspan id="tspan1126" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.26206183px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.00655152" y="136.91661" x="304.65649" sodipodi:role="line">movement for artillery and cavalry to a similar extent.</tspan></text>

ic:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.0103462" y="146.43205" x="284.85281" sodipodi:role="line">low walls provide the best protection to the infantry aside from</tspan><tspan id="tspan1263" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.41384962px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.0103462" y="146.94936" x="284.85281" sodipodi:role="line">dedicated fortification structures. Stone buildings are depicted</tspan><tspan id="tspan953" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:0.41384962px;font-family:sans-serif;-inkscape-font-specification:sans-serif;font-variant-ligatures:normal;font-variant-caps:normal;font-variant-numeric:normal;font-feature-settings:normal;text-align:start;writing-mode:lr-tb;text-anchor:start;stroke-width:0.0103462" y="147.46667" x="284.85281" sodipodi:role="line">in red, wooden buildings in black. </tspan></text>
